import Image from "react-native-web/dist/cjs/exports/Image";
import ScrollView from "react-native-web/dist/cjs/exports/ScrollView";
import Text from "react-native-web/dist/cjs/exports/Text";
import View from "react-native-web/dist/cjs/exports/View";
import createAnimatedComponent from '../../createAnimatedComponent';
const WrappedComponents = {
  View: createAnimatedComponent(View),
  Text: createAnimatedComponent(Text),
  Image: createAnimatedComponent(Image),
  ScrollView: createAnimatedComponent(ScrollView)
};
export default WrappedComponents;
